import {SET_PAGE, SET_USERS} from "./actionConstants";

export const getUsersByPage  = (page) => {
    return dispatch => {
        fetch(
            "ec2-54-237-51-236.compute-1.amazonaws.com:8080/project-server_war/users/page/" + page
        )
            .then(res => res.json())
            .then(json => dispatch(setUsers(json)))
            .catch(error => {
                console.log(error);
            });
    }
}

export const setUsers = users => ({
    type: SET_USERS,
    payload: {
        users: users
    }
});

export const setPage = page => ({
    type: SET_PAGE,
    payload: {
        page: page
    }
});
